/**
 * EventList Component
 */
import React from 'react';
import '../../App.scss';
import EventCardComponent from './Event/EventCardComponent';

const EventListComponent = () => {

    const items = [{
        heading:'ABC',    
    },{
        heading:'EFG',    
    },{
        heading:'HIJ',    
    }]
    return (
        <div>
            <EventCardComponent details={items}/>
        </div>
    )

};

export default EventListComponent;
